  false,\n\t\"url\": null,\n\t\"notes\": \"Spectrum Mapping, LLC was tasked by MAPVI
  - URS Corporation, Albuquergue, to provide airborne Light Detection and Ranging
  (Lidar) of approximately 620 square miles around Nueces County, Texas. MAPVI (Mapping
  Alliance Partnership VI for FEMA Region IV) is a joint venture of URS Corporation,
  Greenhorne & O'Mara and Spectrum Mapping. Spectrum followed data collection and
  processing procedures for Federal Emergency Management Agency (FEMA) Guidelines
  and Specifications Appendix A. Data product deliverables included Lidar to support
  2 foot contours. Spectrum's acquisition division collected the Lidar data on June
  19, 22-25, 27, 28 and July 16 and 17, 2006. The project was collected with a Rams
  ALS50 Lidar sensor, including an inertial measurement unit (IMU) and a dual frequency
  Global Positioning System (GPS) receiver and antenna. Upon receipt of this data,
  the NOAA Coastal Serices Center reclassified all non-ground data to a classification
  of 1 (Unclassified) and all ground points to a classification of 2 (Ground).\",\n\t\"license_title\":
